  (** val string_of_nat_rec : int -> int -> char list **)

  let rec string_of_nat_rec fuel n =
    (fun fO fS n -> if n=0 then fO () else fS (n-1))
      (fun _ -> [])
      (fun fuel0 ->
      if (<) n (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ
           (Pervasives.succ (Pervasives.succ (Pervasives.succ 0))))))))))
      then string_of_base10_digit (Exist n)
      else append
             (string_of_nat_rec fuel0
               (Nat.div n (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ
                 (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ 0))))))))))))
             (string_of_nat_rec fuel0
               (Nat.modulo n (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ
                 (Pervasives.succ (Pervasives.succ (Pervasives.succ (Pervasives.succ 0)))))))))))))
      fuel

  (** val string_of_nat : int -> char list **)

  let string_of_nat n =
    string_of_nat_rec (Pervasives.succ n) n
